#include<iostream>
#include<vector>

using namespace std;

class Solution {
public:
    int longestSubarray(vector<int>& nums, int limit) {                
        int maxlen = 0;
        for (int i = 0 ; i < nums.size(); ++i) {
            int diffMax = 0;
            int Smax = nums[i];
            int Smin = nums[i];
            
            if (maxlen == nums.size())
              return maxlen; // can't do any better

            if (diffMax <= limit) {
                if (maxlen < 1) {
                    maxlen = 1;
                }
            }
            
            for (int j = i+1; j < nums.size(); ++j) {
                int prevSmax = Smax;
                int prevSmin = Smin;
                int prevDiffMax = diffMax;
                if (nums[j] > Smax) {
                    Smax = nums[j];
                }
                if (nums[j] < Smin) {
                    Smin = nums[j];
                }
                diffMax = prevDiffMax + prevSmin - Smin + Smax - prevSmax;
                if (diffMax <= limit) {
                    int len = j - i + 1;
                    if (len > maxlen) {
                        maxlen = len;
                    }
                } else {
                  break;
                }
            }
        }
        return maxlen;
    }
};

